import React, { container } from "react";
import { Container, Row, Col, Card } from "react-bootstrap";

const MyJumbotron = () => {
  return (
    <div>
      <Jumbotron fluid>
        <Container>
          <h1>Booklings</h1>
          <p>
            welcome to the store.
          </p>
        </Container>
      </Jumbotron>
    </div>
  );
};

export default MyJumbotron
